import React from "react";
import data from "../assets/data.json";

const EventsPage = () => {
    const DUMMY_EVENTS = [
        { id: "e1", title: "Some Event" },
        { id: "e2", title: "Another Event" },
    ];
    console.log(data);

    return (
        <>
            <h1>EventsPage </h1>
            <ul>
                {data &&
                    data.length > 0 &&
                    DUMMY_EVENTS.map((event) => (
                        <li index={event.index}>{event.title}</li>
                    ))}
            </ul>
        </>
    );
};

export default EventsPage;
